import React from 'react';
import { useHistory } from "react-router-dom";


export default function Ready({setUser}) {
const history = useHistory();
  setUser()
  return (
    <div>
      <h1>Ready</h1>
      <button onClick={() => {history.push}}>Yes</button>
      <button onClick={() => {setUser(false)}}>No</button>
    </div>
  );
}
